import './css/App.css';
import Header from './Header';
import Footer from './Footer';
import CardVans from './CardVans';
import { json } from 'react-router-dom';

function Vans(data) {
    data = [
        {
            "image": "./css/image/vans1.png",
            "title": "Modest Explorer",
            "price": "$60",
            "unit" : "day",
            "style": "Simple"
        },
        {
            "image": "./css/image/vans2.png",
            "title": "Beach Bum",
            "price": "$80",
            "unit" : "day",
            "style": "Rugged"
        },
        {
            "image": "./css/image/vans3.png",
            "title": "Reliable Red",
            "price": "$100",
            "unit" : "day",
            "style": "Luxury"
        },
        {
            "image": "./css/image/vans4.png",
            "title": "Dreamfinder",
            "price": "$65",
            "unit" : "day",
            "style": "Simple"
        },
        {
            "image": "./css/image/vans5.png",
            "title": "The Cruiser",
            "price": "$120",
            "unit" : "day",
            "style": "Luxury"
        },
        {
            "image": "./css/image/vans6.png",
            "title": "Green Wonder",
            "price": "$70",
            "unit" : "day",
            "style": "Rugged"
        }
    ]

    function getClickTag(e){
        console.log(e)
    }

    return(
        <div>
            <Header/>
            <div className='van-container'>
                <h1>Explore our van options</h1>
                <div className='tag-items' onClick={getClickTag(this)}>
                    <span className='tag-box'>Simple</span>
                    <span className='tag-box'>Luxury</span>
                    <span className='tag-box'>Rugged</span>
                    <button className='tag-button'>Clear filters</button>
                </div>
                <div className='grid'>   
                    {data.map((vanData) =>(
                        <CardVans data = {vanData}/>
                    ))}                
                   
                </div>
            </div>
            <Footer/>
        </div>
    )
}

export default Vans
